    false,nt"url": null,nt"notes": "BPI Structures are derived from a focal
    mean analysis on bathymetry and slope. The bathymetry grid (5 m cell size) is derived
    from bathymetry from four sources: Multibeam bathymetry collected by Coral Reef
    Ecosystem Division aboard NOAA R/V AHI, and NOAA Ship Hi'ialakai; multibeam bathymetry
    collected in Apra Harbor by the Naval Oceanographic Office and NOAA Office of Coast
    Survey; lidar collected by the Naval Oceanographic Office; and lidar collected by
    the Joint Airborne Lidar Bathymetry Technical Center of Expertise. BPI Structures
    was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
    Cell values represent one of 13 classes in an index of seafloor terrains. This data
    set is for the US Territory of Guam.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
